Hello everybody! I'm sorry for the little delay but I had some problems with my connection... anyway, here I am with this new week with Marvel NOW! titles. 

This week, a special mention goes to: 

Infinity 3, the new comic of this great and (IMHO) really interesting cross-over;
Superior Spider-Man 18, where we can see the &quot;Superior&quot; Spidey meet Spider-Man 2099;
Last, Morbius, the Living Vampire 9, the last issue of this series.

So, enjoy and see ya next week!
